    def load_font_selection_combo(self):
        """Update font choices.

        Load font yaml and place key names into the combobox.
        """
        config = load_config()
        if config is not None:
            paragraph = config["fonts"]["paragraph_font"]
            paragraph_size = config["fonts"]["paragraph_size"]
            paragraph_colour = config["fonts"]["paragraph_colour"]

            header = config["fonts"]["header_font"]
            header_size = config["fonts"]["header_size"]
            header_colour = config["fonts"]["header_colour"]

            title = config["fonts"]["title_font"]
            title_size = config["fonts"]["title_size"]
            title_colour = config["fonts"]["title_colour"]

            self.paragraphFontComboBox.addItem(paragraph)
            self.headingFontComboBox.addItem(header)
            self.titleFontComboBox.addItem(title)

            self.paragraphFontColourComboBox.addItem(paragraph_colour)
            self.headingFontColourComboBox.addItem(header_colour)
            self.titleFontColourComboBox.addItem(title_colour)

            self.titleFontSizeSpinBox.setValue(title_size)
            self.headingFontSizeSpinBox.setValue(header_size)
            self.paragraphFontSizeSpinBox.setValue(paragraph_size)

            fonts = font_dict_loader()
            for font in fonts["font_types"].keys():
                self.headingFontComboBox.addItem(font)
                self.paragraphFontComboBox.addItem(font)
                self.titleFontComboBox.addItem(font)

            for font in fonts["custom_font_types"].keys():
                self.titleFontComboBox.addItem(font)

            for font_colour in fonts["font_colours"].keys():
                self.titleFontColourComboBox.addItem(font_colour)
                self.headingFontColourComboBox.addItem(font_colour)
                self.paragraphFontColourComboBox.addItem(font_colour)

    def create_report_button(self, MainWindow):
        """Create report button."""
        config = load_config()
        title = self.reportNameLineEdit.text()
        author = self.reportAuthorLineEdit.text()
        university = self.universityNameLineEdit.text()
        school = self.universitySchoolLineEdit.text()

        args = [title, author, university, school]
        source = os.path.join(config["dir_path"], "data", "database", "species.db")
        # create_report(source, title, author,university, school)
        options = {
            "--Activity": self.Activity.text(),
            "--Clutch": [
                self.clutchRangeMinLineEdit.text(),
                self.clutchRangeMaxLineEdit.text(),
            ],
            "--ClutchMax": [
                self.clutchMaxMinLineEdit.text(),
                self.clutchMaxMaxLineEdit_2.text(),
            ],
            "--ClutchMin": [
                self.clutchMinMinLineEdit.text(),
                self.clutchMinMaxLineEdit.text(),
            ],
            "--EggDiameter": [self.EggDiameterMin.text(), self.EggDiameterMax.text()],
            "--Family": self.familyLineEdit.text(),
            "--Genus": self.genusLineEdit.text(),
            "--GeographicRegion": self.GeographicRegion.text(),
            "--IUCN": self.IUCN.text(),
            "--Longevity": [self.LongevityMin.text(), self.LongevityMax.text()],
            "--MicroHabitat": self.MicroHabitat.text(),
            "--NestingSite": self.NestingSite.text(),
            "--ParityMode": [],
            "--PopTrend": self.PopTrend.text(),
            "--SVLFMx": [self.SVLFMxMin.text(), self.SVLFMxMax.text()],
            "--SVLMMx": [self.SVLMMxMinLineEdit.text(), self.SVLMMxMaxLineEdit.text()],
            "--SVLMx": [self.SVLMxMinLineEdit.text(), self.SVLMxMaxLineEdit_2.text()],
            "--Species": self.speciesLineEdit.text(),
            "--cli": False,
            "--gui": False,
            "--new": False,
            "--no-db": False,
            "--order_taxon_name": self.orderLineEdit.text(),
        }

        font_options = {
            "title_font": self.titleFontComboBox.currentText(),
            "title_size": self.titleFontSizeSpinBox.value(),
            "title_colour": self.titleFontColourComboBox.currentText(),
            "header_font": self.headingFontComboBox.currentText(),
            "header_size": self.headingFontSizeSpinBox.value(),
            "header_colour": self.headingFontColourComboBox.currentText(),
            "paragraph_font": self.headingFontComboBox.currentText(),
            "paragraph_size": self.paragraphFontSizeSpinBox.value(),
            "paragraph_colour": self.paragraphFontColourComboBox.currentText(),
        }
        print(font_options)
        pdf_chapters = self.lineEdit.text()

        if all(args):
            print(f"Args: {title}, {author}, {university}, {school}")
            create_report(
                source,
                options,
                title,
                author,
                university,
                school,
                font_options,
                pdf_chapters,
            )
            self.show_popup()
            self.mainwin.close()
        else:
            print("All fields must be filled")

    def save_font_options(self):
        config = load_config()
        a = self.titleFontComboBox.currentText()
        print(type(a))
        config["fonts"]["default_title_font"] = self.titleFontComboBox.currentText()
        config["fonts"][
            "default_title_colour"
        ] = self.titleFontColourComboBox.currentText()
        config["fonts"]["default_title_size"] = self.titleFontSizeSpinBox.value()

        config["fonts"]["default_header_font"] = self.headingFontComboBox.currentText()
        config["fonts"][
            "default_header_colour"
        ] = self.headingFontColourComboBox.currentText()
        config["fonts"]["default_header_size"] = self.headingFontSizeSpinBox.value()

        config["fonts"][
            "default_paragraph_font"
        ] = self.paragraphFontComboBox.currentText()
        config["fonts"][
            "default_paragraph_colour"
        ] = self.paragraphFontColourComboBox.currentText()
        config["fonts"][
            "default_paragraph_size"
        ] = self.paragraphFontSizeSpinBox.value()

        print(config)
        dump_config(config)
        self.save_font_pop_up()

